import React from 'react'

const Course = ({ course }) => {
    console.log(course)
    return (
        <div>
            <Header name={course.name} />
            <Content />
            <Total />
        </div>
    )
}

const Header = ({ name }) => {
    return (
        <h2>{name}</h2>
    )
}

const Content = () => {
    return (
        <Part />
    )
}
const Part = () => {
    return (
        <p></p>
    )
}
const Total = () => {
    return (
        <strong></strong>
    )
}

export default Course
